      subroutine ev2gm2m(dist,v2b,g2b,imollist,igrad,n)
!Bohr

      implicit none

      integer,intent(in) :: imollist(3), igrad !igrad=0 /1
      integer,intent(in) :: n
      double precision,intent(in)  :: dist(n*(n-1)/2)
      double precision,intent(out) :: v2b(13), g2b(13,3)
      double precision :: v(13), grad(13), disp
      double precision :: r
      integer :: i,j,imol

      ! dist should be in Ang
      ! v2b is in kcal/mol
      ! grad2b is in kcal/molAng
	  ! 1:    N(4S) + N(4S) + O(3P)
	  ! 2-4:  N(4S) + N(4S) + O(1D)
	  ! 5-13: N(4S) + N(2D) + O(3P)
      v2b(1)   =  0.0d0
      v2b(2)   =  1.97
      v2b(3)   =  1.97
      v2b(4)   =  1.97
      v2b(5)   =  2.38
      v2b(6)   =  2.38
      v2b(7)   =  2.38
      v2b(8)   =  2.38
      v2b(9)   =  2.38
      v2b(10)   = 2.38
      v2b(11)   = 2.38
      v2b(12)   = 2.38
      v2b(13)   = 2.38

      g2b = 0.0d0 
      do i=1,n*(n-1)/2
        r=dist(i) !!!*0.529177d0    for Bohr
        imol=imollist(i)

        call ev2gm2(r,v,grad,imol,igrad,disp)
        v2b = v2b + v/23.061d0
        if (igrad.eq.1) then
          do j=1,13
            g2b(j,i) = grad(j)/23.061d0 !! (23.061d0/0.529177d0) for Bohr
          enddo
        endif
      enddo

      end subroutine ev2gm2m

      subroutine ev2gm2(r,v,grad,imol,igrad,disp) 
!**********************************************************************
!
! Compute the diatomic potential of groupd-state triplet O2
!
! References: J. Chem. Phys. 132, 074307 (2010)
!
! Input:  r      interatomic distance in Angstrom
! Output: V      potential in kcal/mol
!         grad   gradient (kcal/mol)/Angstrom
