         else if (i.eq.5) then
alpha =         9.6867
beta =  0.6179
as(0) =         10506.1975
as(1) =         10061.7827
as(2) =         -4322.7098
as(3) =         9010.1727
as(4) =         -6354.4772
as(5) =         2123.3026
as(6) =         -697.9472
as(7) =         103.1147
!alpha =     1.6922
!beta =  1.6287
!as(0) =     -4600.3607
!as(1) =     13446.0702
!as(2) =     -18932.8845
!as(3) =     60638.6186
!as(4) =     -172569.9170
!as(5) =     1324948.5946
!as(6) =     -30212287.9428
!as(7) =     3740738517.7558

! U44 N2(B 3Pi_g)+O(3P)
          else if ((i.eq.6).or.(i.eq.7).or.(i.eq.8)) then
alpha =     10.342
beta =  0.7045
as(0) =     20065.4904
as(1) =     1140.4593
as(2) =     -9781.3064
as(3) =     26621.9383
as(4) =     -25103.6272
as(5) =     20141.5967
as(6) =     -9606.4985
as(7) =     1542.6002

! N2(W 3Del_u)+O(3P)
          else if ((i.eq.9).or.(i.eq.10).or.(i.eq.11)) then
!alpha =     1.3115
!beta =  1.1668
!as(0) =     -202920.8937
!as(1) =     1410418.1834
!as(2) =     -4616791.4975
!as(3) =     9108373.1492
!as(4) =     -11656365.7719
!as(5) =     9703803.8599
!as(6) =     -4888780.5576
!as(7) =     1160959.1716
alpha = 	3.9117
beta = 	0.8532
as(0) = 	975086.6175
as(1) = 	-4009384.418
as(2) = 	7818516.455
as(3) = 	-9272102.251
as(4) = 	7184822.208
as(5) = 	-3625761.788
as(6) = 	1107721.913
as(7) = 	-160431.5751
! U1212-1313
          else if ((i.eq.12).or.(i.eq.13)) then
alpha =     6.06756
beta =  0.82366
as(0) =     2225226.54029
as(1) =     -10200176.50546
as(2) =     23145559.78199
as(3) =     -33237233.58199
as(4) =     32222320.08322
as(5) =     -20756075.09015
as(6) =     8080035.20683
as(7) =     -1439167.87039
gam =   510.59639
del =   4.16108

endif

        else if (imol.eq.3) then   ! NO data imol=3
            
! U11 NO(a 4_i) + N(4S
          if (i.eq.1) then
alpha =     3.5124
beta =  0.9476
as(0) =     17862980.6515
as(1) =     -53774481.5152
as(2) =     40173905.4211
as(3) =     24722189.3018
as(4) =     -35421450.1351
as(5) =     -9580810.3340
as(6) =     23584658.8525
as(7) =     -7549918.6887

! U22 NO(b 4_-) + N(4S)
        else if (i.eq.2) then
alpha =     3.4397
beta =  0.9197
as(0) =     10120680.3619
as(1) =     -40294100.0092
as(2) =     59510743.7425
as(3) =     -29292507.9761
as(4) =     -19401365.8983
as(5) =     32353447.7571
as(6) =     -15727759.4932
as(7) =     2747022.6440

! U33 NO(X 2_r) +N(2P_3.57)_V3
         else if (i.eq.3) then
alpha = 	6.5118
beta = 	0.7943
as(0) = 	299845.2771
as(1) = 	-974915.6935
as(2) = 	1670097.9005
as(3) = 	-1811360.6800
as(4) = 	1300810.4028
as(5) = 	-589500.7381
as(6) = 	149035.2831
as(7) = 	-15888.0978
! U44 NO(X 2_r) +N(2P_3.57)_V4
          else if (i.eq.4) then
alpha = 	11.1548
beta = 	0.679
as(0) = 	57601.9562
as(1) = 	-56097.4031
as(2) = 	65533.9603
as(3) = 	-48548.5299
as(4) = 	33674.3657
as(5) = 	-13241.9392
as(6) = 	1040.9114
as(7) = 	449.0204
! U55-99 NO(X 2_r) +N(2D_2.365)
          else if ((i.eq.5).or.(i.eq.6).or.(i.eq.7) &
.or.(i.eq.8).or.(i.eq.9))  then
alpha =     6.9634
beta =  0.7557
as(0) =     55496.4320
as(1) =     -101113.9076
as(2) =     133668.3275
as(3) =     -120762.1170
as(4) =     83209.2468
as(5) =     -38238.3803
as(6) =     10620.8346
as(7) =     -2058.6642

!U1010 NO(X 2_r) +N(2P)_V10
          else if (i.eq.10) then
alpha = 	12.0823
beta = 	0.6387
as(0) = 	40857.2240
as(1) = 	-19637.2192
as(2) = 	27884.5833
as(3) = 	-18364.0347
as(4) = 	16994.4071
as(5) = 	-10107.0826
as(6) = 	2767.7155
as(7) = 	-294.7023
! U1111-1313 NO(B 2_r) +N(2D)_V11
          else if ((i.eq.11).or.(i.eq.12).or.(i.eq.13)) then
alpha = 	10.2224
beta = 	0.6528
as(0) = 	48449.5614
as(1) = 	-55184.3106
as(2) = 	69282.9602
as(3) = 	-45702.5326
as(4) = 	18875.2239
as(5) = 	-963.1668
as(6) = 	-2310.9114
as(7) = 	509.3777
gam = 	76.9897
del = 	6.0907
endif
        endif      
      
        do k=0,7
          v(i)= v(i) + as(k)*dexp(-alpha*beta**k*r**2)
        enddo

        if (imol.eq.2) then
          if ((i.eq.12).or.(i.eq.13)) then
           v(i)= v(i) + gam*dexp(-del*(r-1.7d0)**2)
          else if ((i.eq.2).or.(i.eq.3).or.(i.eq.4)) then
           call n2ground(r,v(i),grad(i),imol,igrad)
          endif
        else if (imol.eq.3) then
          if ((i.eq.11).or.(i.eq.12).or.(i.eq.13)) then
             v(i)= v(i) + gam*dexp(-del*(r-1.7d0)**2)
          else if ((i.eq.5).or.(i.eq.6).or.(i.eq.7).or.(i.eq.8).or.(i.eq.9)) then
           call noground(r,v(i),grad(i),imol,igrad)
          endif
        endif

        ! Add D3 dispersion correction
        v(i)=v(i)+disp  !!!

        ! Compute the gradient if needed
        if (igrad.eq.1 .and. .not.((imol.eq.2 .and. i.eq.2) .or. (imol.eq.2 .and. i.eq.3) .or. (imol.eq.2 .and. i.eq.4) .or. &
                (imol.eq.3 .and. i.eq.5) .or. (imol.eq.3 .and. i.eq.6) .or. &
                (imol.eq.3 .and. i.eq.7) .or. (imol.eq.3 .and. i.eq.8) .or. &
                (imol.eq.3 .and. i.eq.9))) then


          do k=0,7
            grad(i)=grad(i)-2.d0*as(k)*alpha*beta**k*r*dexp(-alpha*beta**k*r**2)
          enddo
        !gam del were not used, add this part if necessary
          if (imol.eq.2) then
            if ((i.eq.12).or.(i.eq.13)) then
              grad(i)=grad(i)-2.0d0*del*gam*(r-1.7d0)*dexp(-del*(r-1.7d0)**2)
            endif
          else if (imol.eq.3) then
          if ((i.eq.11).or.(i.eq.12).or.(i.eq.13)) then
              grad(i)=grad(i)-2.0d0*del*gam*(r-1.7d0)*dexp(-del*(r-1.7d0)**2)
            endif
          endif
          grad(i)= grad(i) + dispdr(1)
        endif

      enddo
      return
      end subroutine ev2gm2

      subroutine d3disp(dist,disp,dispdr,igrad,imol)
!**********************************************************************
! Dispersion correction based on Grimme's D3(BJ) calculation for
! diatomic pairs
!
! Several subroutines of DFTD3 V3.1 Rev 1 by Grimme were merged into 
! subroutine edisp and they have been heavily modified to calculate only
! that dispersion energy correction that is needed.
!
! S. Grimme, J. Antony, S. Ehrlich and H. Krieg
! J. Chem. Phys, 132 (2010), 154104
! and 
! S. Grimme, S. Ehrlich and L. Goerigk, J. Comput. Chem, 32 (2011),
! 1456-1465
!
! The C6 values are fixed.
!
!**********************************************************************

      double precision cn(2),s6,s8,rs6,rs8
      double precision dist(1), e6(1), e8(1), disp, dispdr(1), c6(2)
      double precision e6dr(1),e8dr(1)
      integer iz(2), mxc(94), i, j, igrad
      double precision c6ab(94,94,5,5,3)
      double precision r2r4(94)
      double precision autoang,autokcal
      integer imol

      autoang =0.52917726d0
      autokcal=627.509541d0

! Generalized parameters for BJ damping from P. Verma, B. Wang, 
! L. E. Fernandez, and D. G. Truhlar, J. Phys. Chem. A 121, 2855 (2017)
      s6= 1.0d0
      s8= 2.0d0
      rs6= 0.5299d0 !!it's not unit conversion
      rs8= 2.20d0

      do i=1,1
      dist(i)=dist(i)/autoang

     enddo

      if (imol.eq.2) then !!N2
! iz for N2 system
      iz(1)=7
      iz(2)=7

! C6 for N2 system
      c6(1)=19.7d0 
      c6(2)=19.7d0 
      else if (imol.eq.3) then ! NO
! iz for NO system
      iz(1)=7
      iz(2)=8

! C6 for NO system
      c6(1)=16.7d0 
      c6(2)=16.7d0     
      else
! currently imol = 2 & 3 are used
      stop
      endif

! Calculate dispersion correction
      call edisp(94,5,2,dist,iz,mxc, &
           rs6,rs8,e6,e8,e6dr,e8dr,c6,0)

      disp = 0.0d0

      do i=1,1
      disp =disp + (-s6*e6(i)-s8*e8(i))*autokcal
      enddo

      if (igrad .eq. 1) then
      call edisp(94,5,2,dist,iz,mxc, &
           rs6,rs8,e6,e8,e6dr,e8dr,c6,1)

      dispdr(:) = 0.0d0

      do i=1,1
      dispdr(i) =dispdr(i) + (-s6*e6dr(i)-s8*e8dr(i))*autokcal/autoang
      enddo
      endif
      do i=1,1
      dist(i)=dist(i)*autoang
      enddo

      end subroutine d3disp

!**********************************************************************
! compute energy
!**********************************************************************
      subroutine edisp(max_elem,maxc,n,dist,iz,mxc, &
                 rs6,rs8,e6,e8,e6dr,e8dr,c6a,igrad)

      integer n,iz(2),max_elem,maxc,mxc(max_elem) 
      double precision dist(1),r2r4(max_elem),r0ab(max_elem,max_elem)
      double precision rs6,rs8,rcov(max_elem)
